import { ColorString } from "../../ColorPalette";
import styledComponents from "styled-components";
import { SchmoozSubscribeForm } from "../SchmoozSubscribeForm";

const HamburgerMenu = styledComponents.nav``;

export function Menu() {
  return (
    <HamburgerMenu
      className="sandwich-menu"
      style={{
        flexDirection: "column",
        backgroundColor: ColorString.schmoozGreen,
        zIndex: 10,
        height: 400,
        border: 10,
        borderWidth: 40,
        borderColor: ColorString.red,
        alignContent: "center",
        alignItems: "center",
      }}
    >
      <a
        className="text-medium"
        style={{
          fontSize: 30,
          textDecoration: "none",
          color: ColorString.white,
          fontWeight: "bold",
          backgroundColor: ColorString.transparent,
        }}
        href="terms.html"
      >
        Home
      </a>
      <a
        className="text-medium"
        style={{
          fontSize: 30,
          textDecoration: "none",
          color: ColorString.white,
          fontWeight: "bold",
          backgroundColor: ColorString.transparent,
        }}
        href="terms.html"
      >
        About
      </a>
      <a
        className="text-medium"
        style={{
          flex: 1,
          fontSize: 30,
          textDecoration: "none",
          color: ColorString.white,
          fontWeight: "bold",
          backgroundColor: ColorString.transparent,
        }}
        href="terms.html"
      >
        Terms
      </a>
      <a
        className="text-medium"
        style={{
          flex: 1,
          fontSize: 30,
          textDecoration: "none",
          color: ColorString.white,
          fontWeight: "bold",
          backgroundColor: ColorString.transparent,
        }}
        href="terms.html"
      >
        Contact
      </a>
    </HamburgerMenu>
  );
}
